    "Driver ASICs for Advanced Deformable Mirrors Project",nt"tracking_summary":
    {ntt"total": 14,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T01:26:19.905699",nt"name": "driver-asics-for-advanced-deformable-mirrors-project",nt"isopen":
    true,nt"url": null,nt"notes": "The program leverages on our extensive expertise
    in developing high-performance driver ASICs for deformable mirror systems and seeks
    to expand the capacities of the proposed novel ASIC technology to beyond what have
    been possible by using traditional techniques. The overall goal of the SBIR program
    will be to develop a new class of Application Specified Integrated Circuit (ASIC)
    driver technology to be used in driver electronics of a deformable mirror (DM) system
    for reducing power dissipation, improving controllability, enforcing multiplexing
    bandwidth, and significantly reducing the form factors of the entire DM system for
    adaptive optics. Through the Phase I project, we aims to transform the technology
    readiness level from TRL 1 to TRL 2, and in Phase II, the technology readiness level
    for the proposed ASIC driver system will be promoted from TRL 2 to TRL 4 within
    a 2-year time frame.",nt"license_title": "U.S. Government Work",nt"extras":
